import React from 'react';

const About = () => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'Right',
                alignItems: 'Right',
                text: 'center',
                height: '100vh',
                width: '70vw'
            }}
        >
            <h1>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Autem exercitationem possimus qui quisquam quod? Aperiam aut beatae commodi, deleniti dignissimos dolor ea, facere hic impedit maiores necessitatibus nihil nisi perspiciatis.</h1>
        </div>
    );
};

export default About;
